import React from "react";

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard</h1>
      <p>
        Welcome to the User Dashboard! Here you can manage your tasks and
        communications.
      </p>
    </div>
  );
};

export default Dashboard;
